    - ID: "5a236869-e375-49c0-a92d-0c2f1db7788f"
      Hint: Content
      Value: ClariFly&reg; Larvicide does not harm parasitic wasps. Wasps that parasitize fly pupae seek out pupae in the field. The female wasp drills a hole into the pupa and lays eggs inside the pupal case of the fly. As the immature wasps develop, they feed on the fly pupae that is transforming into an adult, killing the fly in the process. Fly larvae in ClariFly&reg; Larvicide treated manure die before they can form pupae, so the wasps are unaffected. ClariFly&reg; Larvicide can have a negative impact on dung beetle larvae (but not adults) that feed on manure from treated cattle.
